import React from "react";
import "../../styles/LandingPage.scss";
import "../../styles/LoadingScreen.css";
import { NavLink } from "react-router-dom";
import { Fade } from "react-reveal";
import Footer from "../components/Footer";
import Navbar from "../components/Header";
// import graphic from "../../static/media/test-about3.png";
import arrow_right from "../../static/media/arrow.svg";
import download_icon from "../../static/media/download.svg";
import portrait from "../../static/media/2.jpg";

const LandingPage = () => {
  return (
    <React.Fragment>
      <Navbar />
      <div
        id="download-button"
        onClick={() => {
          window.location.href =
            "https://drive.google.com/file/d/1_cl8fCnSdGW-dx0qY2OfF_bNJ6evrEgT/view?usp=sharing";
        }}
      >
        <p>Download Resume</p>
        <img src={download_icon} alt="" />
      </div>
      <div className="about-me">
        {/* <div className="large-text">
          
        <img className="background-pictures" src={} /> */}

        {/* <Footer /> */}

        {/* <div className="centered-section">
          <p>Hello, I'm Matt Ly.</p>
          <h1>Data Analyst</h1>
          <Footer />
        </div> */}
      </div>
      <div className="landing-page-parent">
          <Fade top>
            <h1 className=" react-reveal large-text-header">
              Data
              <br />
              Analyst
            </h1>
          </Fade>
        <Fade cascade>
          <div className="landing-text-area">
            <img src={portrait} className="landing-pic" alt="" />
            {/* <h1 className="large-text">
              Data             
              <br />
              Analyst
            </h1> */}
            <h1>
              Matt Ly
            </h1>
            <div className="buttons">
              <NavLink to="/experience" exact>
                <div className="experience-button">
                  <p>View Experience</p>
                  <img src={arrow_right} alt="" className="arrow-right" />
                </div>
              </NavLink>

              <div
                className="outline-button"
                onClick={() => {
                  window.location.href = "mailto:mattlyldc21@gmail.com";
                }}
              >
                <p>Let's talk!</p>
              </div>
            </div>
          </div>
        </Fade>

        <div className="footer-div">
          <Footer />
        </div>
      </div>
    </React.Fragment>
  );
};

export default LandingPage;
